import React from 'react';
import { Link } from 'react-router-dom';
import { Typography } from '@mui/material';

const Header = () => {
  return (
    <header>
      <Link to="/" style={{ textDecoration: 'none', color: 'inherit' }}>
        <Typography variant="h6">Home</Typography>
      </Link>
    </header>
  );
};

export default Header;
